            "You flip to a random page and read. A unique bond exists between members of the Royal Guild. Guild oaths are more than words—they bind members’ spirits, granting them strength when defending one another in times of crisis. The closer the bond, the stronger their shared power.",
            "You flip to a worn and torn page. It is said that not all guilds remain known to the world. Some ancient guilds vanished in mysterious circumstances, leaving behind clues hidden in the depths of forgotten ruins. Aetherons guild has existed for thousands of years, much of this old knowledge lost.",
            "You flip to a random page and read. The title of Kingsman is as much a burden as it is an honor. With it comes not only the protection of Aetheron but also the task of deciding the fate of entire realms. Kingsmen hold the power to reshape the very fabric of the world—but wielding such power always comes at a cost. Very few have achieved this rank.",
